import styled from "styled-components";


export const About_Header_Wrapper = styled.header`
  display: flex;
  place-items: center;
  justify-content: center;
`;
export const About_Header_Image_Wrapper = styled.div`
img {
  max-width: 795px;
}
`;
export const About_Header_Text_Wrapper = styled.div`
  width: 100%;
  max-width: 450px;
  
`;
